import React, { Component } from 'react'

class insurance extends Component {
    render() {
        return (
            <div>
                <Grid container>
                    <Grid item sm={8} xs={12}>
                        <p>Hello</p>
                    </Grid>
                </Grid>
            </div>
        )
    }
}

export default insurance
